import React, { useState } from 'react';
import axios from 'axios';
import './PatientForm.css';

const PatientForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    age: '',
    gender: '',
    phone: '',
    address: '',
    date: '',
    maritalStatus: '',
    referredBy: '',
    chiefComplaint: [],
    medicalHistory: [],
    allergies: '',
    medications: '',
    dentalHistory: [],
    clinicalFindings: {
      first: [],
      second: [],
      third: [],
      fourth: [],
    },
    investigations: [],
    diagnosis: '',
    treatmentPlan: [],
    orthoProfile: {
      facialProfile: '',
      lipCompetency: '',
      overjet: '',
      overbite: '',
      habits: [],
      molarRelation: '',
      crossbite: '',
      openbite: ''
    },
    prescriptions: [{ drugName: '', dosage: '', duration: '' }],
    department: [],
    dentistName: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleCheckboxChange = (section, value) => {
    setFormData(prev => {
      const list = prev[section];
      return {
        ...prev,
        [section]: list.includes(value)
          ? list.filter(item => item !== value)
          : [...list, value],
      };
    });
  };

  const handleToothChange = (quadrant, toothNumber, field, value) => {
    setFormData(prev => {
      const updatedQuadrant = [...(prev.clinicalFindings[quadrant] || [])];
      const index = updatedQuadrant.findIndex(t => t.toothNumber === toothNumber);

      if (index !== -1) {
        updatedQuadrant[index].condition[field] = value === 'true';
      } else {
        updatedQuadrant.push({
          toothNumber,
          condition: {
            cavity: field === 'cavity' && value === 'true',
            mobility: field === 'mobility' && value === 'true',
            missing: field === 'missing' && value === 'true',
            filling: field === 'filling' && value === 'true',
          }
        });
      }

      return {
        ...prev,
        clinicalFindings: {
          ...prev.clinicalFindings,
          [quadrant]: updatedQuadrant,
        }
      };
    });
  };

  const renderToothRow = (quadrantName) => {
    const teeth = ['11', '12', '13', '14', '15', '16', '17', '18'];
    return (
      <table>
        <thead>
          <tr>
            <th>Tooth No.</th>
            <th>Cavity</th>
            <th>Mobility</th>
            <th>Missing</th>
            <th>Filling</th>
          </tr>
        </thead>
        <tbody>
          {teeth.map(tooth => (
            <tr key={`${quadrantName}-${tooth}`}>
              <td>{tooth}</td>
              {['cavity', 'mobility', 'missing', 'filling'].map(field => (
                <td key={field}>
                  <select onChange={(e) => handleToothChange(quadrantName, tooth, field, e.target.value)}>
                    <option value="false">--</option>
                    <option value="true">Yes</option>
                  </select>
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/api/patients', formData);
      alert('Patient data saved successfully!');
      console.log('Saved:', response.data);
    } catch (error) {
      console.error('Error saving patient:', error);
      alert('Failed to save patient. Please try again.');
    }
  };

  return (
    <div className="form-container">
      <h2>Dental OP Case Sheet</h2>
      <form onSubmit={handleSubmit}>
        <fieldset>
          <legend>Patient Information</legend>
          <label>Name: <input type="text" name="name" value={formData.name} onChange={handleChange} /></label>
        </fieldset>

        <fieldset>
          <legend>Clinical Findings</legend>
          <h4>First Quadrant</h4>
          {renderToothRow('first')}
          <h4>Second Quadrant</h4>
          {renderToothRow('second')}
          <h4>Third Quadrant</h4>
          {renderToothRow('third')}
          <h4>Fourth Quadrant</h4>
          {renderToothRow('fourth')}
        </fieldset>

        <button type="submit">Save Patient</button>
      </form>
    </div>
  );
};

export default PatientForm;
